(577, 1, '2018-02-03 00:37:13', '2018-02-03 00:37:13', '<p style=\"text-align: left;\">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed tamen intellego quid velit. Quis istud possit, inquit, negare? Cum praesertim illa perdiscere ludus esset. Quaerimus enim finem bonorum.</p>\nNihil enim iam habes, quod ad corpus referas; Quod quidem nobis non saepe contingit. Peccata paria. Qui est in parvis malis.\n\nHoc loco tenere se Triarius non potuit. Id mihi magnum videtur. Duo Reges: constructio interrete. Quae contraria sunt his, malane?\n\nNam ante Aristippus, et ille melius. Videsne, ut haec concinant? Etenim semper illud extra est, quod arte comprehenditur. Quod si ita sit, cur opera philosophiae sit danda nescio. Quis est tam dissimile homini. Haeret in salebra.\n\nComprehensum, quod cognitum non habet? Videmus igitur ut conquiescere ne infantes quidem possint. Sullae consulatum? Quodcumque in mentem incideret, et quodcumque tamquam occurreret.', 'Blog post 2', '', 'inherit', 'closed', 'closed', '', '442-autosave-v1', '', '', '2018-02-03 00:37:13', '2018-02-03 00:37:13', '', 442, 'http://localhost/wpzaman/2018/02/03/442-autosave-v1/', 0, 'revision', '', 0),
