(878, 1, '2018-03-22 12:41:23', '2018-03-22 16:41:23', '<h2>Add Your Heading Text Here</h2>\r\n<img src=\"http://localhost/wpzaman/wp-content/uploads/2018/02/stock-member-1-1024x682.jpeg\" sizes=\"(max-width: 1024px) 100vw, 1024px\" srcset=\"http://localhost/wpzaman/wp-content/uploads/2018/02/stock-member-1-1024x682.jpeg 1024w, http://localhost/wpzaman/wp-content/uploads/2018/02/stock-member-1-300x200.jpeg 300w, http://localhost/wpzaman/wp-content/uploads/2018/02/stock-member-1-768x512.jpeg 768w, http://localhost/wpzaman/wp-content/uploads/2018/02/stock-member-1-272x182.jpeg 272w, http://localhost/wpzaman/wp-content/uploads/2018/02/stock-member-1.jpeg 1280w\" alt=\"\" width=\"1024\" height=\"682\" />\r\n\r\nQuicquid enim a sapientia proficiscitur, id continuo debet expletum esse omnibus suis partibus; Octavio fuit, cum illam severitatem in eo filio adhibuit, quem in adoptionem D. Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. Neque enim disputari sine reprehensione nec cum iracundia aut pertinacia recte disputari potest. Duo Reges: constructio interrete. Omnes enim iucundum motum, quo sensus hilaretur. Nam prius a se poterit quisque discedere quam appetitum earum rerum, quae sibi conducant, amittere. Effluit igitur voluptas corporis et prima quaeque avolat saepiusque relinquit causam paenitendi quam recordandi. Aufidio, praetorio, erudito homine, oculi capto, saepe audiebam, cum se lucis magis quam utilitatis desiderio moveri diceret. Introduci enim virtus nullo modo potest, nisi omnia, quae leget quaeque reiciet, unam referentur ad summam. Quis non odit sordidos, vanos, leves, futtiles? Non est ista, inquam, Piso, magna dissensio. Sed fortuna fortis;,\r\n\r\n<a href=\"#\">\r\nClick me\r\n</a>\r\n<h1>this is a test with html code with bootstrap library</h1>\r\n<h1>Example heading with bootstrap library New</h1>\r\n<button type=\"button\">Primary</button>\r\n<button type=\"button\">Secondary</button>\r\n<button type=\"button\">Success</button>\r\n<button type=\"button\">Danger</button>\r\n<button type=\"button\">Warning</button>\r\n<button type=\"button\">Info</button>\r\n<button type=\"button\">Light</button>\r\n<button type=\"button\">Dark</button>\r\n<button type=\"button\">Link</button>', 'Elementor Edited post 9 Lorem ipsum dolor sit amet, consectetur adipiscing elit.', '', 'inherit', 'closed', 'closed', '', '628-revision-v1', '', '', '2018-03-22 12:41:23', '2018-03-22 16:41:23', '', 628, 'http://localhost/wpzaman/628-revision-v1/', 0, 'revision', '', 0),
